@keyframes SlideLeftOut {

.e-ripple,
.e-ripple-style {
  overflow: hidden;
  position: relative;
  transform: translate3d(0, 0, 0);
}

.e-ripple-element,
.e-ripple-style::after {
  background-color: rgba(0, 0, 0, 0.1);
  border-radius: 100%;
  overflow: hidden;
  pointer-events: none;
  position: absolute;
  transform: scale(0);
  transition: opacity, transform 0ms cubic-bezier(0, 0.1, 0.2, 1);
}

.e-ripple-style::after {
  background: rgba(0, 0, 0, 0.3);
  content: '';
  display: block;
  height: 50%;
  left: 25%;
  opacity: 0;
  top: 25%;
  transform: scale(3);
  transition: transform .5s, opacity .5s;
  width: 50%;
}

.e-ripple-style:active::after {
  opacity: 1;
  transform: scale(0);
  transition: 0s;
}
